import React from "react";
import Input from '@mui/joy/Input';
import Button from '@mui/joy/Button';
import AuthStyle from "../../../../styles/Auth/Auts.css";

const {FormAuth} = AuthStyle

function Regist() {

    

    return (
        <>
            <FormAuth action="POST">
                <Input
                    placeholder="Введите логин"
                    size="md"
                    variant="soft"
                />
                <Input
                type="password"
                    placeholder="Введите пароль"
                    size="md"
                    variant="soft"
                />
                <Button type="submit" onClick={function(){}}>Войти</Button>
            </FormAuth>
        </>
    )
}

export default Regist
